import React from 'react';
import './Scouting.css';
import Position from '../../img/Position/Bottom.png';
import imageRank from '../../img/Rank/Season_2019_-_Gold_3.png';


class Scouting extends React.Component {

    


    constructor (props){
        super(props);
        this.state = {
            summonerName: 'Martinounux',
            imgMainPosition: Position,
            Rank: {
                imgRank: imageRank,
                rankName: 'Gold III',
                LP: 'O',
                Win: '53',
                lose: '45',
            }
        };
        
    }


    render() {
        return(
            <div id="Scouting">
                <h1>SCOUTING</h1>
                <div id="border">
                    <div id="SummonerName">
                        {this.state.summonerName}
                    </div>
                    <div id="positionRank">
                        <img src={this.state.imgMainPosition} id="PosImg"/>
                        <img src={this.state.Rank.imgRank} id="RankImg"/>
                        <div id="textRank">
                        <div id="rankName">{this.state.Rank.rankName}</div>
                            <div id="LP">{this.state.Rank.LP} LP</div>
                            <div id="winLose">{this.state.Rank.Win}W {this.state.Rank.lose}L </div>
                        </div>
                    </div>
                    <div id="mostValuableRank">

                    </div>
                </div>
            </div>
        );
    }
}

export default Scouting;
